import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './assets/components/Header';
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <>
      <Header />
      <section id='history'>
        <Container>
          <h2 className='text-center'>La Storia</h2>
        </Container>
      </section>
    </>
  );
}

export default App;
